import './App.css';

function App() {
  return (
    <div className="App">
      <div id='container'>
        <div>
          <div className='main-title'>25 + 5 Clock</div>
          <div className='length-control'>
            <div>Break Length</div>
          </div>
          <div className='length-control'>
            <div>Session Length</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
